import React from 'react'
import axios from 'axios'

const Generos = () => {
    const [data, setData] = React.useState([])
    React.useEffect(() => {
        axios
            .get('generos')
            .then(res => {
                setData(res.data)
            })
    }, [])
    return (
        <div>
            <h1>Generos</h1>
            <pre>{JSON.stringify(data)}</pre>
        </div>       
    )
}

export default Generos
